measurements.description:
Three flowers on three inflorescences, held strikingly above foliage;
dorsal sepal yellow blushed red, caudae darker red; lateral sepals yellow, mainly overlaid saturated red, darker venation,  caudae crossed distally, dark red;
petals minute, white;
lip minute, white tipped red; column yellow, anther cap cream; substance hard; texture cilliate.
